const BoxDown = (props) => {
    const sunriseTime = new Date(props.sunrise);
    const sunsetTime = new Date(props.sunset)

    const sunrise = (sunriseTime.getHours()) + ":" + (sunriseTime.getMinutes());
    const sunset = (sunsetTime.getHours()) + ":" + (sunsetTime.getMinutes());

    return (
        <div style={boxLeftStyle}>
            <div>{props.feels}</div>
            <hr />
            <div>{props.wind}</div>
            <hr />
            <div>{props.humidity}</div>
            <hr />
            <div>{sunrise}</div>
            <hr />
            <div>{sunset}</div>
        </div>
    )
}

const boxLeftStyle = {
    margin: 0,
    padding: 0,
    width: '100%',
    height: '44%',
    background: 'rgba(255, 255, 255, 0.8)',
    borderRadius: '25px',
    boxShadow: '5px 5px 10px 5px rgba(0,0,0,0.1)'
}

export default BoxDown;
